INSERT INTO `system_qa_msg` (`id`, `answer`, `question`, `sortId`) VALUES
(1, '<p><span style="font-family: 微软雅黑; font-size: 24px;">保证金交易是指在买卖业务中，市场参与者不需对投资物进行全额资金划拨，只需按照标的总额支付一定比例的价款。这种交易手段减轻了交易者的资金压力，提高了资金的使用效率。</span></p><p style="text-align: left;"><br/></p>', '什么是保证金交易？', 0),
(2, '<h1 label="标题居左"><span style="font-size: 24px;">=&gt;交易安全保证：大连大宗交易中心权威认证，授权我盈互联（北京）网络科技有限公司开放麒麟贵金属白银、石油等投资品种。</span></h1><h1 label="标题居左"><span style="font-size: 24px;">=&gt;资金安全保证：支持第三方支付合利宝和招商银行支付，支持各大银行在线充值提现，资金流水均由第三方操作。</span></h1><h1 label="标题居左"><span style="font-size: 24px;">=&gt;系统安全保证：数据传输加密、7*24小时实时的严格监控管理、采用业界顶级加密算法防止信息隐私泄露、多层防火墙有效防范入侵确保数据安全。</span></h1><p><br/></p>', '在麒麟贵金属投资有怎样的安全保障？', 0),
(3, '<p style="margin-left:19px;line-height:32px"><span style="font-family: Wingdings;">Ø&nbsp;</span><span style="font-family: 微软雅黑;">双向盈利，买涨买跌均可赚钱</span></p><p style="margin-left:19px;line-height:32px"><span style="font-family: Wingdings;">Ø&nbsp;</span><span style="font-family: 微软雅黑;">资金利用率高，最大可放大20倍交易</span></p><p style="margin-left:19px;line-height:32px"><span style="font-family: Wingdings;">Ø&nbsp;</span><span style="font-family: 微软雅黑;">交易风险可控，T+0随时买卖</span></p><p style="margin-left:19px;line-height:32px"><span style="font-family: Wingdings;">Ø&nbsp;</span><span style="font-family: 微软雅黑;">资金存管安全，由第三方支付机构合利宝托管</span></p><p style="margin-left:19px;line-height:32px"><span style="font-family: Wingdings;">Ø&nbsp;</span><span style="font-family: 微软雅黑;">交易时间灵活，最长全天20小时可交易</span></p><p><br/></p>', '在麒麟贵金属投资有哪些优势？', 0);
